function draw() {
  createCanvas(windowWidth, windowHeight);
  background(bg);
  
 if(gameState === "start"){
  b1.velocityY = 0;
  b1.visible = false
  player.visible = false
  space.visible = true
  larrow.visible = true
  rarrow.visible = true


    
  player.x = windowWidth/2;
  player.y = 500;
  
  fill("yellow")
  textSize(30);
  textFont('Fantasy');
  text("All around the Universe ", windowWidth/2-120,windowHeight/2 - 70);
  text("Press SPACE to start", windowWidth/2 - 105,windowHeight/2 );
  textSize(20);
  text("Press SPACE to move upwards", 40, 100 )
  text("Use LEFT and RIGHT arrow keys for sideways movement", windowWidth - 460, 110)
  
  drawSprites()

  if(keyDown("space")){
    gameState = "play";
    launchSound.play()
    launchSound.setVolume(0.25)
  }
 }

 if(gameState==="play"){
   
   b1.velocityY = 4;
   space.visible = false
   larrow.visible = false
   rarrow.visible = false
   b1.visible = true
   player.visible = true
   live1.visible = true
   live2.visible = true
   live3.visible = true
   live4.visible = true
   live5.visible = true


  //  bgtheme.play();
  //  bgtheme.setVolume(0.5);
   
   if(keyDown("space")){
      player.velocityY = -10;
      }

   if(keyDown("left")){
      player.x = player.x - 5;
    }

    if(keyDown("RIGHT")){
     player.x = player.x + 5;
    }

   player.velocityY = player.velocityY + 0.8;

   if(b1.y> windowHeight-10){
      b1.y = windowHeight/2
    }
    
    

   spawnAsteroids();
   spawn2Asteroids();
   spawnFastAsteroids();
   spawnPowerups();
  //  spawnPlanets();

   drawSprites();

   
   player.collide(ground)
   player.collide(ground2)
   player.collide(ground3)
   
   score = score + Math.ceil(frameRate()/speed)
   if (score > highscore){
     highscore = score
   }

   stroke("black")
   fill("yellow");
   textFont('Monospace');
   textSize(20);
   text("Score: " + score,100,100)
 
   if(willCollide){
    if(asteroidGroup.isTouching(player) ){
      lives.pop();
      asteroidGroup.destroyEach();
      player.changeAnimation("collided", hitAnimation);
      willCollide = false;
      time = setTimeout(function(){ player.changeAnimation("running", player_running); willCollide = true; }, 5000);
      explodeSound.play()
      explodeSound.setVolume(0.5)


    }
   }

   if(powerupGroup0.isTouching(player)){
     powerupSound.play();
     powerupGroup0.destroyEach();
     speed = 75
     player.changeAnimation("fast", fastshipImage)
     restore2 = setTimeout(function(){speed = 150; player.changeAnimation("running", player_running);}, 10000)
     

   }

   if(powerupGroup1.isTouching(player)){
     powerupSound.play();
     powerupGroup1.destroyEach();
     willCollide = false
     player.changeAnimation("collided", hitAnimation)
     restore = setTimeout(function(){willCollide = true; player.changeAnimation("running", player_running);}, 10000)
   }

   if(planetGroup.isTouching(player)){
     gameState = "info"
   }
 

   if(lives.length < 1  || player.y > windowHeight + 30){
    
    gameState = "end"

   }

 

   if(lives.length == 4 ){
    live5.remove()
   }
   if(lives.length == 3){
     live4.remove()
   }
   if(lives.length == 2){
     live3.remove()
   }
   if(lives.length == 1){
     live2.remove()
   }
   if(lives.length == 0){
     live1.remove()
   }



 }

 if(gameState == "info"){
  b1.velocityY = 0;
  space.visible = false
  larrow.visible = false
  rarrow.visible = false
  display_data = planet_data[ran]

  fill("#FF5F1F")
  textSize(30);
  textFont('Fantasy');
  text("Press W to resume", windowWidth/2-110 ,windowHeight-100)
  text(display_data.name, windowWidth/2-110 ,windowHeight-200)
  text(display_data.distance_from_earth, windowWidth/2-110 ,windowHeight-300)


  if(keyDown("w") || keyDown("W")){
    gameState = "play";
    planetGroup.destroyEach();
    player.x = windowWidth/2;
    player.y = windowHeight/2;
  }
 }
  
 if(gameState === "end"){
   b1.velocityY = 0;
   space.visible = false
   larrow.visible = false
   rarrow.visible = false

   
   player.x = windowWidth/2;
   player.y = 500;
   
   fill("yellow")
   textSize(30);
   textFont('Fantasy');
   text("Game Over", windowWidth/2-55,windowHeight/2 - 110);
   text("Press R to restart", windowWidth/2 - 100,windowHeight/2-70);
   text("Score: " + score, windowWidth/2 - 50 ,windowHeight/2 -30);
   text("Highscore: " + highscore, windowWidth/2 -80 ,windowHeight/2 + 10 )
   
   
   if(keyDown("r")){
     gameState = "play";
     score = 1;
     launchSound.play()
     launchSound.setVolume(0.25)
     lives = [live1, live2, live3, live4, live5]
     live1 = createSprite(50, windowHeight - 50, 50, 50)
     live1.addImage(heartImage)
     live1.scale = 0.1
     lives.push(live1)
     live2 = createSprite(100, windowHeight - 50, 50, 50)
     live2.addImage(heartImage)
     live2.scale = 0.1
     lives.push(live2)
     live3 = createSprite(150, windowHeight - 50, 50, 50)
     live3.addImage(heartImage)
     live3.scale = 0.1
     lives.push(live3)
     live4 = createSprite(200, windowHeight - 50, 50, 50)
     live4.addImage(heartImage)
     live4.scale = 0.1
     lives.push(live4)
     live5 = createSprite(250, windowHeight - 50, 50, 50)
     live5.addImage(heartImage)
     live5.scale = 0.1
     lives.push(live5)

     player.changeAnimation("running", player_running)
      
   }
    // if(touches.length>0) {      
    //   gameState = "play";
    //  score = 0;
    //   touches = []
    // }
   
 }


}

function spawnAsteroids(){
  if(frameCount%150===0){
    asteroid = createSprite(Math.round(random(0,windowWidth), 0, 30,30));
    asteroid.velocityY = (4 + score/500)
    asteroid.addImage(asteroidImage);
    asteroid.scale = 0.25;
    asteroid.lifetime = 400;
    
    asteroidGroup.add(asteroid);
    
  }
}

function spawn2Asteroids(){
  if(frameCount%300==0){
    asteroid = createSprite(Math.round(random(0,windowWidth), 0, 30,30));
    asteroid.addImage(asteroidImage);
    asteroid.velocityY = (4 + score/500)
    asteroid.scale = 0.25;
    asteroid.lifetime = 400;

    asteroidGroup.add(asteroid)
  }
}

function spawnFastAsteroids(){
  if(frameCount%600 == 0){
    asteroid = createSprite(Math.round(random(0,windowWidth), 0, 30,30));
    asteroid.addImage(asteroidImage);
    asteroid.velocityY = (7 + score/500)
    asteroid.scale = 0.25;
    asteroid.lifetime = 400;

    asteroidGroup.add(asteroid)
  }
}

function spawnPowerups(){
  if(score%1000==0){
    rand = Math.round(random(1, 2))
    powerup = createSprite(Math.round(random(0,windowWidth), 0, 30,30));
    powerup.velocityY = 4
    powerup.lifetime = 400;
    powerup.scale = 0.4
    if(rand == 1){
      powerup.addImage(multiplierImage)
      powerupGroup0.add(powerup)
    }
    else{
      powerup.addImage(shieldImage)
      powerupGroup1.add(powerup)
    }
  }
}

function spawnPlanets(){
  if(score%500==0){
    planet = createSprite(100, 0, 30, 30);
    planet.velocityY = 4;
    planet.lifetime = 400;
    planet.addImage(terrestrialImage);
    planet.scale = 0.35
    // planet.debug = true
    planet.setCollider("rectangle", 0, 0, windowWidth*16, 100)
    planetGroup.add(planet)
  }
}